import React from "react";
import "./People.css";
import Header from "./Header";
import { SearchInput } from "evergreen-ui";

function People() {
    return (
        <div>
            <Header />
            <div className="people">
                <SearchInput width={800} height={45} />
            </div>
        </div>
    );
}

export default People;
